/* Base-size for rem */
html {
  font-size: 9px;
  line-height: 1.5rem;
}

body {
  font-family: var(--text-font-family), var(--text-font-family-fallback), var(--text-font-base);
  font-weight: normal;
  color: var(--text-color);
}
h1, h2, h3 {
  font-family: var(--header-font-family), var(--header-font-family-fallback);
  color: var(--text-color-light);
}
.remark-slide-content {
  background-color: var(--background-color);
  font-size: 1rem;
  padding: 2rem 3rem 1.5rem 3rem;
  width: 100%;
  height: 100%;
}
.remark-slide-number {
  color: var(--alice-500);
  opacity: 1;
  font-size: 0.9em;
  display: var(--display-page);
}
.remark-code-line-highlighted {
  background-color: var(--code-highlight-color);
}

/* Inverse class */
.inverse {
  background-color: var(--inverse-background-color);
  color: var(--inverse-text-color);

}
.inverse h1, .inverse h2, .inverse h3 {
  color: var(--inverse-header-color);
}
.inverse a, .inverse a &gt; code {
  color: var(--inverse-link-color);
}
img, video, iframe {
  max-width: 100%;
}
blockquote {
  border-left: solid 5px lightgray;
  padding-left: 1em;
}

/* For Printing */
@page { margin: 0; }
@media print {
  .remark-slide-scaler {
    width: 100% !important;
    height: 100% !important;
    transform: scale(1) !important;
    top: 0 !important;
    left: 0 !important;
  }
}



/* Font styling */
.hi {
  font-weight: 600;
}
.mono {
  font-family: monospace;
}
.ul {
  text-decoration: underline;
}
.ol {
  text-decoration: overline;
}
.st {
  text-decoration: line-through;
}
.bf {
  font-weight: bold;
}
.it {
  font-style: italic;
}

/* Example */
.ex {
  font-weight: 300;
  color: #555F61 !important;
  font-style: italic;
}

/* Attention */
.attn {
  font-weight: 500;
  color: #e64173 !important;
}

/* Note */
.note {
  font-weight: 300;
  font-style: italic;
  color: #314f4f !important;
}

/* Question and answer */
.qa {
  font-weight: 500;
  color: #e64173 !important;
}

/* Figure Caption */
.caption {
  font-size: 0.75em;
  font-style: italic;
  line-height: 1.5;
  color: var(--alice-400);
}



/* Font Sizes */

}

  font-size: 1.25rem;

}
.remark-slide-content h3 {
  font-size: 1rem;

}


/* Title Slide */
.title-slide .inverse .remark-slide-content {
  background-color: #FAFAFA;
}
.title-slide {
  background-color: #FAFAFA;

}

  text-shadow: none;
  text-align: left;
  margin-left: 1.5rem;
}

  font-weight: 300;

  text-align: left;
  margin-left: 1.5rem;
  margin-bottom: 0rem;
}
/* Name */
.title-slide h3:last-of-type  {
  font-style: italic;
  font-size: 1rem;
}

/* Header */
h1 {
  margin-top: -5px;
  margin-left: -0px;

}

  padding-top: -15px;
  padding-bottom: 0px;
  margin-left: 0px;
}

/* Subheader */
.subheader{
  font-weight: 100;
  font-style: italic;
  display: block;
  margin-top: -25px;
  margin-bottom: 25px;
}

/* Links */
a {
  color: var(--alice-500);
  background-color: var(--alice-50);
  padding: 0.125rem 0.25rem;
}
a:hover {
  color: var(--alice-700);
}

/* Figures */
.figure {
  padding: 1.5rem 0rem;
}

/* Lists */
ol, ul {
  padding-left: 2rem;
}
li {
    margin-top: 4px;
}

/* Code Chunks */
.remark-code, .remark-inline-code {
  font-family: var(--code-font-family), Menlo, Consolas, Monaco, Liberation Mono, Lucida Console, monospace;
}
.remark-code {
  font-size: 1rem;
  display: block;
  overflow-x: auto;
  padding: 0.5rem 0.5rem !important;
  background: var(--daisy-100) !important;
  border-left: var(--daisy-400) solid 2px;
}


/* Remark code */

.remark-inline-code {
  font-size: var(--code-inline-font-size);
  color: #000;
  background: #F5F5F5; /* lighter */
  border-radius: 0.125rem;
  padding: 0.125rem 0.25rem;
}
.remark-code-line{
  min-height: 0rem;
}




/* Xaringan tweeks */

/* turns off slide numbers for title page: https://github.com/gnab/remark/issues/298 */
.title-slide .remark-slide-number {
  display: none;
}


/* No line numbers with classes: clear, inverse */
.clear .remark-slide-number {
  display: none;
}
.inverse .remark-slide-number {
  display: none;
}
.remark-code-line-highlighted {
  background-color: rgba(249, 39, 114, 0.5);
}
.inverse {

.title-slide {

}
.footnote {
  position: absolute;
  bottom: 1em;
  padding-right: 6em;
  font-size: 1rem;
  color: #7f7f7f;
}







/* 2/3 left; 1/3 right */
.more-left {
  float: left;
  width: 63%;
}
.less-right {
  float: right;
  width: 31%;
}
.more-right ~ * {

# Install R and RStudio

The first part of the assignment is aimed at getting your computers set up for the rest of the course. You need to download two different softwares. 

1. [R](https://cloud.r-project.org/) is the statistical software that we will use for this course.

2. [RStudio Desktop](https://www.rstudio.com/products/rstudio/download/) is a visual code editor that makes editing and running code way easier. This is what I will use to demonstrate all the coding in the class.

You will know that you have installed R and RStudio Desktop correctly if when you start RStudio, you see the following message in the Console tab.

&lt;img src=&quot;data:image/png;base64,#R-startup.png&quot; width=&quot;50%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

Good job! Now, we have to install two packages. Copy the following lines into the console and hit enter. This will take a minute or two, but once you have done this you will be ready for the semester.


```r
install.packages(&quot;tidyverse&quot;)
install.packages(&quot;rmarkdown&quot;)
```

It should look like this when you are finished:

&lt;img src=&quot;data:image/png;base64,#R-installed.png&quot; width=&quot;50%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

# R Markdown

You should download the file `HW0.Rmd` from canvas. It&#39;s a good idea to put all the files for the course into a seperate folder so that they all stay together and you don&#39;t accidentally delete them. Students in the past just leave them in the messy Downloads folder which makes things hard to find. Double click `HW0.Rmd` and it should open up in RStudio automatically. 

Welcome to your first RMarkdown document! You might feel very lost, so the first thing 
we will do is have you read through some resources to familiarize yourself with 
Markdown and RMarkdown. To begin, read through these pages:

1. [Using Markdown](https://evalf21.classes.andrewheiss.com/resource/markdown/)

2. [Using RMarkdown](https://evalf21.classes.andrewheiss.com/resource/rmarkdown/)

## Instructions for Assignment

Two things for you to do for this assignment.

1. Chose a theme for our html_document

  At the top of the Rmd document, there is `YAML` data between the two `---` tags. Choose a theme by looking at this [Theme Gallery](https://www.datadreaming.org/post/r-markdown-theme-gallery/).  If it says from `____` package, you can install that package using `install.packages(&quot;____&quot;)`. 
  
  While you are there, change the name parameter to your name.

2. Fill out the few tasks given in the document

3. Upload completed html file to canvas.
